delimiter ;;
CREATE PROCEDURE `insert_tb_lease`(IN n INT)
BEGIN
    DECLARE i INT DEFAULT 1;
    DECLARE buildId INT DEFAULT 3;
    DECLARE customerId INT DEFAULT 1;
    DECLARE buildName VARCHAR(20) DEFAULT ('珠江新城');
    DECLARE location VARCHAR(20) DEFAULT ('广州');
		DECLARE customerName VARCHAR(20) DEFAULT ('曾伊丽');		
		DECLARE phone VARCHAR(20) DEFAULT('15274435963');
		DECLARE price INT DEFAULT 3000;
		DECLARE leaseType VARCHAR(20) DEFAULT('押二付一');
		DECLARE payment VARCHAR(20) DEFAULT('微信支付');
		DECLARE statu VARCHAR(20) DEFAULT('租期中');
    WHILE i < n DO
				concat('2019-',floor(1+rand()*12),'-01 ', floor(10+rand()*10),':',floor(10+rand()*49),':',floor(10+rand()*49)));
        SET i = i + 1;
    END WHILE;
END
;;
delimiter ;

